import Navbar from "../../components/navbar/Navbar.js";
import Featured from "../../components/featured/featured.jsx";
import List from "../../components/list/list.jsx";
import "./Home.css";
import { useState,useEffect } from "react";
import axios from "axios";
import { SettingsEthernetOutlined } from "@material-ui/icons";


const Home = ({type}) => {


    const [lists, setlists] = useState([]);
    const [genre, setgenre] = useState(null);

    useEffect( () => {
        const getRandomLists = async() => {
            try {

                const res = await axios.get(
                  `lists${type ? "?type=" + type : ""}${
                    genre ? "&genre=" + genre : ""
                  }`,
                  {
                    headers: {

                        token:"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxY2FhMzExNjRkODQ4M2MwMDNiODhhNCIsImlzQWRtaW4iOnRydWUsImlhdCI6MTY0MjAzODY1NCwiZXhwIjoxNjQyNDcwNjU0fQ.M81cvWy2401Km_O55YjQ0wZBDZnHtEECO1gxMYnSCcM"
                    },
                  }
                );

                setlists(res.data);

              }catch(err) {

                console.log(err);
            }
        };
        getRandomLists()
    },[type, genre]);

    return (
        <div className="Home">
            <Navbar/>

            <Featured type = {type} setGenre={SettingsEthernetOutlined}/>


{lists.map((list) => (
        <List list={list} />
      ))}


        </div>
    )
}

export default Home
